-- database unit test for dbo.CreateTopic
DECLARE @RC AS INT, @Key AS VARCHAR (128), @ContentType AS VARCHAR (128), @ParentID AS INT, @Attributes AS [dbo].[AttributeValues], @ExtendedAttributes AS XML, @References AS [dbo].[TopicReferences], @Version AS DATETIME;

SELECT @RC = 0,
       @Key = NULL,
       @ContentType = NULL,
       @ParentID = 0,
       @ExtendedAttributes = NULL,
       @Version = getdate();

EXECUTE @RC = [dbo].[CreateTopic] @Key, @ContentType, @ParentID, @Attributes, @ExtendedAttributes, @References, @Version;

SELECT @RC AS RC;

